<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Maintenance Page</title>
    <link rel="preconnect" href="https://fonts.googleapis.com" />
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
    <link
      href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;600;700&display=swap"
      rel="stylesheet"
    />
    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
        font-family: "Poppins", sans-serif;
        color: #242232;
      }

      .background {
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: center;
        min-height: 100vh;
        padding: 20px 258px;
        overflow: hidden;
      }

      .heading {
        font-size: 100px;
        font-weight: 600;
        line-height: 110px;
      }

      .text {
        margin-top: 8px;
        margin-bottom: 34px;
        font-size: 26px;
        line-height: 44px;
        font-weight: 400;
      }

      .status {
        display: block;
        margin-bottom: 34px;
        font-size: 22px;
        font-weight: 400;
        line-height: 28px;
        color: #0033ad;
        text-decoration: underline;
      }

      .status:active {
        opacity: 0.7;
      }

      .btn {
        display: inline-block;
        padding: 12px 28px;
        border-radius: 100px;
        font-size: 16px;
        line-height: 24px;
        background-color: #0033ad;
        color: white;
        text-decoration: none;
        box-shadow: 1px 2px 11px 0px rgba(0, 18, 61, 0.37);
      }

      .error-image {
        position: fixed;
        right: -50px;
        top: 50%;
        transform: translateY(-50%);
        z-index: -1;
      }

      .bg-orange,
      .bg-blue {
        position: fixed;
        z-index: -10;
      }

      .bg-orange {
        right: -650px;
        bottom: -650px;
      }

      .bg-blue {
        left: -400px;
        top: -500px;
      }

      @media (max-width: 1024px) {
        .background {
          padding: 20px 120px;
        }

        .heading {
          font-size: 57px;
          font-weight: 700;
          line-height: 64px;
        }

        .error-image {
          right: -400px;
        }
      }

      @media (max-width: 768px) {
        .background {
          padding: 20px 32px;
        }

        .bg-orange,
        .bg-blue {
          width: 600px;
          height: 600px;
        }

        .bg-orange {
          right: -250px;
          bottom: -150px;
        }

        .bg-blue {
          left: -250px;
          top: -150px;
        }
      }

      @media (min-width: 1025px) and (max-height: 800px) {
        .background {
          padding: 20px 100px;
        }
      }
    </style>
  </head>
